        {props.temperature && <p>TEMPERATURE : {props.temperature}</p> }
        {props.humidity && <p>HUMIDITY : {props.humidity}</p> }
        {props.description && <p>CONDITIONS : {props.description}</p> }
        {props.error && <p>{props.error}</p>}
    </div>  
);


export default Weather;
